import React from 'react'
import { Col, Container, Row } from 'react-bootstrap'
import logo from '../images/logo.png'
const NavBar = ({search}) => {
const onSearch=(word)=>{
search(word)
}
  
  return (
    <div className="nav-style w-100">
    <Container>
    <Row className="pt-2  ">
      <Col xs="2" lg="1">
      {/* way 1111
    <a href="/">   </a>     reload page*/}
    <Link to="/">  {/*without reload */}
          <img className="logo" src={logo} alt="dfs" />{ /* src="logo.png" if it was in public */}
      </Link>
      </Col>
      <Col xs="10" lg="11" className=" d-flex align-items-center">
        <div className="search  w-100">
          <i className="fa fa-search"></i>
          <input onChange={(e)=>onSearch(e.target.value)}  type="text" className="form-control" placeholder="ابحث" />
        </div>
      </Col>
    </Row>
  </Container>
    </div>
  )
}

export default NavBar
